import React, { useState } from 'react';


export default function Main() {
  
  let list = [
    {productName: 'Shoes', price: 100},
    {productName: 'Jacket', price: 200},
    {productName: 'Xyz', price: 150},
    {productName: 'Shirt', price: 190},
  ]

  return (
    <div className='container d-flex flex-wrap gap-3 mt-4'>
      {
        list.map((product) => ( 
          <div className="card" style={{width:'300px'}}>
            <img className="card-img-top" src="https://via.placeholder.com/300" alt="Title" />
            <div className="card-body">
              <h4 className="card-title">{product.productName}</h4>
              <p className="card-text">{product.price}</p>
            </div>
          </div>
        ))
      }
    </div>
  )
}
